INSERT INTO `v1_53c15d6b1d21c479c0fa8af493d7f2a174ed8fffac415300d3402519ae8b9546` VALUES ("---", 1, 1, 6000, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 0, 3, 2, "", "アサヒ");
INSERT INTO `v1_53c15d6b1d21c479c0fa8af493d7f2a174ed8fffac415300d3402519ae8b9546` VALUES ("アドレナリン", 3, 1, 16000, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 3, 0, 3, "ホームランを連発すると、連発数に応じてパワーアップする", "部員3");
INSERT INTO `v1_53c15d6b1d21c479c0fa8af493d7f2a174ed8fffac415300d3402519ae8b9546` VALUES ("ラッキー", 2, 1, 30000, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 2, 2, 4, "幸運のハプニングを呼び込む", "{0}");
INSERT INTO `v1_53c15d6b1d21c479c0fa8af493d7f2a174ed8fffac415300d3402519ae8b9546` VALUES ("", 0, 0, 50000, "みんなの知らない極秘情報がのっているおまけページ。決して誰かに見せてはいけない。", 1, 1, 5, "", "選手名鑑 おまけページ");
